import React from "react";
import classes from "./myCheckbox.module.scss";

const MyCheckbox = () => {
  return (
    <span>
      <input
        id="id"
        name="name"
        type="checkbox"
        className={classes.myCheckbox}
      />
      <label htmlFor="id">sdfsfsfsdfsdf</label>
    </span>
  );
};

export default MyCheckbox;
